import React from "react";

function Home() {
  return (
    <div className='home'>
      <img className='homeImage' src='../uploads\background.jpg ' alt='backgroundimage' />
      <h1 className='homemaintext'>FPV Build</h1>
      <h3 className='homemaintext'>Share Your KWAD Build</h3>
    </div>
  );
}

export default Home;
